import Jobs from './components/Jobs';
export default function App(){
    return(
        <>
      {/*   Nav Bar */}
      
      <header>
            {/* <img src={logo} alt='logo' width='180px'/> */}
            <div>
                <a href="#" className={s.navItems}>Home</a>
                <a href="#" className={s.navItems}>Services</a>
                <a href="#" className={s.navItems}>About</a>
                <a href="#" className={s.navItems}>Jobs</a>
            </div>
            <button className={s.btn}>Contact</button>
        </header>

        {/* Secciones */}
        <section id='home'><Home/></section>
        <section id='services'><Services/></section>
        <section id='about'><About/></section>
        <section id='jobs'><Jobs/></section>
        </>
    )
}
